export default [
  {
    path: '/',
    redirect: 'login'
  },
  {
    path: '*',
    name: 'not-found',
    component: () => import('@/shared/components/NotFound.vue')
  },
  {
    path: '/inicio',
    name: 'inicio',
    component: () => import('@/Visitante/views/Inicio.vue')
  },
  {
    path: '/login',
    name: 'login',
    component: () => import('@/Visitante/views/Login.vue')
  }
]
